import react from 'react';
import "./App.css";
import {BrowserRouter,Routes,Route} from "react-router-dom";
import {LoginPage} from "./Routes.js";

const App = () => {
  return (
    <BrowserRouter>
    <Routes>
      <Route path='login' element={<LoginPage/>}/>
    </Routes>
    </BrowserRouter>
  )
}

export default App
